module("Jive Table Plugin", {
	setup: function(){
        this.rte = editor.get("wysiwygtext");
        this.contextPlugin = ed.plugins.jivecontextmenu;
        $j.fx.off = true; //all jQuery animations complete instantly
    },
    teardown: function(){
        this.contextPlugin.hideMenu();
        this.contextPlugin.lastPosition = null;
        $j.fx.off = false;
    }
});

function scrollIntoView(elem, callback){
    var scrollTop;
    if(typeof elem == "number"){
        scrollTop = elem;
    }else{
        scrollTop = $j(elem).offset().top-150;
    }

    if(callback){
        ed.onScroll.add(function handler(){
            ed.onScroll.remove(handler);
            callback.apply(this, arguments);
        });
    }
    setTimeout(function(){
        $j(ed.getWin()).scrollTop(scrollTop);
    }, 0);
    return scrollTop;
}

asyncTest("table row options break if table doesn't have style set JIVE-2057", function() {
    var that = this;
	ed.setContent('<body><table width=\"100%\">\n<tbody>\n<tr>\n<th><strong>Header 1</strong></th><th><strong>Header 2</strong></th>\n</tr>\n<tr>\n<td><br /></td>\n<td><br /></td>\n</tr>\n<tr>\n<td><br /></td>\n<td><br /></td>\n</tr>\n</tbody>\n</table>\n<p> </p></body>');

    var cell = $j('td:first', ed.getBody()).get(0);
    var rng = ed.dom.createRng();
    rng.setStart(cell, 0);
    rng.collapse(true);
    ed.selection.setRng(rng);

    ed.nodeChanged();

    setTimeout(function(){
        var e = new jQuery.Event("click");
        e.target = cell;
        ed.onClick.dispatch(ed, e);
    }, 100);

    setTimeout(function(){
        try{
            var $ro = ed.plugins.jivetablecontrols.$rowopts;
            var $cell = $j("td:first", ed.getBody());
            var p = $ro.position();
            var o = $cell.offset();

            near(p.left, o.left, 2, "left offset is correct");
            near(p.top, o.top - 10, 4, "top offset is correct");
            near($ro.height(), $cell.outerHeight() + 16, 2, "height is correct");

            ed.plugins.jivetablecontrols.$rowopts.mousedown();
            var e = new jQuery.Event("mousemove");
            e.pageY = $ro.offset().top + 60;
            e.pageX = $ro.offset().left + 60;
            ed.plugins.jivetablecontrols.$rowopts.trigger(e);
        }catch(e){
            ok(false, "exception was thrown");
        }
    }, 200);

    setTimeout(function(){
        ed.plugins.jivetablecontrols.$rowopts.mouseup();
        start();
    }, 350);
});


