asyncTest("CS-24475 new table button can add new table", function() {
    var that = this;
	ed.setContent('<p>test</p>');

    var p = ed.getBody().firstChild;
    var rng = ed.dom.createRng();
    rng.setStart(p, 0);
    rng.collapse(true);
    ed.selection.setRng(rng);

    ed.nodeChanged();
    var $menu;

    setTimeout(function(){
        ed.controlManager.get("jivetablebutton").settings.onclick();
        $menu = ed.plugins.jivetablebutton.$menu;
    }, 50);

    setTimeout(function(){
        var e = new jQuery.Event("mousemove");
        e.pageY = $menu.offset().top + 60;
        e.pageX = $menu.offset().left + 60;
        $menu.trigger(e);
    }, 70);

    setTimeout(function(){
        equals($menu.find(".row.label").text(), "3 x 3", "menu has expanded to be larger table");

        var e = new jQuery.Event("click");
        e.pageY = $menu.offset().top + 60;
        e.pageX = $menu.offset().left + 60;
        $menu.trigger(e);
    }, 80);

    setTimeout(function(){
        equals($j(ed.getBody()).find("table").length, 1, "table was created");
        equals($j(ed.getBody()).find("table tr").length, 4, "table has 4 rows (3 for body)");
        equals($j(ed.getBody()).find("table tr:first th").length, 3, "table has 3 headers");
        equals($j(ed.getBody()).find("table tr:eq(1) td").length, 3, "table has 3 cells in each row");
        equals($j(ed.getBody()).find("table tr:eq(2) td").length, 3, "table has 3 cells in each row");
        equals($j(ed.getBody()).find("table tr:eq(3) td").length, 3, "table has 3 cells in each row");
        start();
    }, 90);
});

